#include <bits/stdc++.h>
using namespace std;

class Solution {
public:
    vector<string> findRelativeRanks(vector<int>& score) {
        vector<string> res(score.size());
        vector<pair<int, int>> map;
        for (int i=0;i<score.size();i++) map.push_back({score[i], i});
        sort(map.begin(), map.end());
        int rank=score.size();
        for (auto& x : map) {
            // cout << x.first << " " << x.second << endl;
            if (rank==3) res[x.second] = "Bronze Medal";
            else if (rank==2) res[x.second] = "Silver Medal";
            else if (rank==1) res[x.second] = "Gold Medal";
            else res[x.second] = to_string(rank);
            rank-=1;
        }
        return res;
    }
};

